import{_ as s,o as n,c as a,z as e,a as t}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 10.1-1119.1 State Forests System Fund established.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/10.1-1119.1.md","filePath":"vacode/10.1-1119.1.md"}'),r={name:"vacode/10.1-1119.1.md"},o=e("h1",{id:"§-10-1-1119-1-state-forests-system-fund-established",tabindex:"-1"},[t("§ 10.1-1119.1 State Forests System Fund established. "),e("a",{class:"header-anchor",href:"#§-10-1-1119-1-state-forests-system-fund-established","aria-label":'Permalink to "§ 10.1-1119.1 State Forests System Fund established."'},"​")],-1),d=e("p",null,'There is hereby created in the state treasury a special nonreverting fund to be known as the State Forests System Fund, hereafter referred to as "the Fund." The Fund shall be established on the books of the Comptroller. All contributions from income tax refunds and any other source shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. Moneys in the Fund shall be used solely for the purposes of developing and implementing conservation and education initiatives in the state forests system. Expenditures and disbursements from the Fund shall be made by the State Treasurer on warrants issued by the Comptroller upon written request signed by the State Forester.',-1),i=e("p",null,[t("1999, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0998",target:"_blank",rel:"noreferrer"},"998"),t(".")],-1),l=[o,d,i];function h(u,c,m,f,p,b){return n(),a("div",null,l)}const F=s(r,[["render",h]]);export{y as __pageData,F as default};
